import { actionTypes } from "../actions/loading.action";

const initialState = {
  ITEMS: []
}

export default (state = initialState, {type, payload}) => {
  switch (type) {
    
    case actionTypes.ITEMS:
      return {payload};

    default:
      return state;
  }
}
